        const all = document.querySelectorAll("iframe");
        const elemToKeep = all[0];
        if (elemToKeep) {
            elemToKeep.removeAttribute("border");
            document.querySelector(".pb-footer").prepend(elemToKeep);
            all.forEach(elem => {
                if (elem != elemToKeep) {
                    elem.remove();
                }
            });
        }
    });
</script>
